import './App.css';
import Navbar from './Navbar'
import Body from './Body'
import Card from './Card'
import Bottom from './Bottom'
import Data from "./Data.js";
import main from "./ma"



function App() {
  const{products} = Data;
  return (
    <div className='App'>
      <Navbar/>
      <Body/>
      <Card products={products}> </Card>
      <Bottom/>

    </div>
  );
}
export default App;
